import React, { useState, useEffect } from "react";
import axios from "axios";
import { useAuth } from "./authcontext";
import { useNavigate } from "react-router-dom";

// --- CONFIGURATION ---
// Assumed separate backend service for Expert knowledge base
const KNOWLEDGE_BASE_URL = "http://localhost:8000"; 
// ---

export default function ExpertPanel() {
  const { user, logout } = useAuth();
  const [query, setQuery] = useState("");
  const [response, setResponse] = useState("");
  const [logs, setLogs] = useState([]);
  
  const expertId = user.id;
  const nav = useNavigate();
  
  // Security check: Redirect if not logged in as expert
  useEffect(() => {
    if (!user.id || user.role !== 'expert') {
      nav('/login?role=expert');
    }
  }, [user.id, user.role, nav]);


  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!query || !response) {
      console.error("Please fill both fields");
      return; 
    }
    if (!expertId) {
      console.error("User ID missing. Cannot submit log.");
      return;
    }

    try {
      // POSTs new knowledge log to the separate knowledge base backend
      await axios.post(`${KNOWLEDGE_BASE_URL}/store_log`, {
        expert_id: expertId,
        query,
        response, 
      });
      console.log("‚úÖ Log stored in ChromaDB successfully!");
      setQuery("");
      setResponse("");
      loadLogs(); // Refresh the log list
    } catch (err) {
      console.error("‚ùå Error storing log:", err);
    }
  };

  const loadLogs = async () => {
    if (!expertId) return;

    try {
      // GETs logs from the separate knowledge base backend
      const res = await axios.get(`${KNOWLEDGE_BASE_URL}/get_logs/${expertId}`);
      // Assuming res.data structure is { logs: { documents: [...] } }
      setLogs(res.data.logs.documents || []); 
    } catch (err) {
      console.error("Error loading logs", err);
    }
  };
  
  // Load logs on component mount
  useEffect(()=>{
    if (expertId) {
        loadLogs();
    }
  },[expertId]);

  const handleSignOut = () => {
    logout();
    nav('/');
  }

  if (!user.id || user.role !== 'expert') {
    return null; 
  }

  return (
    <>
        <div className="header">
            <div className="title">üõ†Ô∏è Expert Knowledge Panel (Expert: {user.id})</div>
            <div style={{display:"flex", gap:12}}>
              <button className="btn outline" onClick={handleSignOut}>Sign out</button>
            </div>
        </div>
        <div style={{ padding: "20px" }}>
            <h2>Create New Knowledge Log</h2>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    placeholder="Problem or query..."
                    value={query}
                    onChange={(e) => setQuery(e.target.value)}
                    style={{ display: "block", width: "100%", marginBottom: "10px", padding: "8px", border: "1px solid #ccc", borderRadius: "4px" }}
                />
                <textarea
                    placeholder="Expert response or fix (one step per line)..."
                    value={response}
                    onChange={(e) => setResponse(e.target.value)}
                    rows={6}
                    style={{ display: "block", width: "100%", marginBottom: "10px", padding: "8px", border: "1px solid #ccc", borderRadius: "4px" }}
                />
                <button type="submit" className="btn">Save to Knowledge Base</button>
            </form>

            <hr style={{margin: '20px 0'}} />

            <h2>View Stored Logs ({logs.length} items)</h2>
            <button onClick={loadLogs} className="btn outline">Refresh Logs</button>
            <ul style={{listStyleType: 'disc', paddingLeft: '20px'}}>
                {logs.length === 0 ? <p>No logs found for this expert.</p> :
                 logs.map((log, i) => (
                    <li key={i} style={{marginBottom: '10px', wordBreak: 'break-word'}}>{log}</li>
                ))}
            </ul>
        </div>
    </>
  );
}
